// src/components/CursosCiclo.js
import React from "react";
import './cursosCiclo.css';

function CursosCiclo() {
    return (
        <div className="cursos-ciclo-container">
            <h3>Este ciclo llevas 7 cursos</h3>
            <div className="cursos-ciclo">
                <button className="arrow arrow-left">‹</button> {/* Left arrow */}

                <div className="curso virtual">
                    <i className="icon-video"></i> {/* Icon for virtual */}
                    <p>Desarrollo de Software II</p>
                    <span className="label virtual">Virtual en vivo</span>
                </div>
                <div className="curso virtual">
                    <i className="icon-video"></i>
                    <p>Teoría de Lenguajes de Programación y Métodos de Traducción II</p>
                    <span className="label virtual">Virtual en vivo</span>
                </div>
                <div className="curso presencial">
                    <i className="icon-classroom"></i> {/* Icon for presencial */}
                    <p>Diseño y Desarrollo de Juegos Interactivos I</p>
                    <span className="label presencial">Presencial</span>
                </div>
                <div className="curso empty"></div> {/* Placeholder for empty course */}

                <button className="arrow arrow-right">›</button> {/* Right arrow */}
            </div>
        </div>
    );
}

export default CursosCiclo;
